import React, { useState, useEffect } from "react";
import axios from "axios";
import Table from "react-bootstrap/Table";

function SpecialistAppointments() {
  const token = localStorage.getItem("token");
  const email = localStorage.getItem("email");
  const [loadedData, setData] = useState([]);

  const loadData = async () => {
    const url = "http://localhost:56210/appointment/getSpecialistAppointments";

    try {
      const data = await fetch(url, {
        headers: {
          Authorization: `Bearer ${token}`,
        },
      });
      const data1 = await data.json();
      console.log(data1);
      setData(data1.list);
    } catch (error) {
      console.log("error", error);
    }
  };

  useEffect(() => {
    loadData();
  }, []);

  return (
    <div style={{ backgroundColor: "aquamarine" }}>
      {loadedData && (
        <Table>
          <thead>
            <th>#</th>
            <th>Date and time</th>
            <th>Referral</th>
          </thead>
          <tbody>
            {loadedData.map((value) => (
              <tr key={value.id}>
                <th></th>
                <th>{value.date}</th>
                <th>
                  <textarea placeholder="Write perscription" />
                </th>
              </tr>
            ))}
          </tbody>
        </Table>
      )}
    </div>
  );
}

export default SpecialistAppointments;
